TEM observations were performed to reveal the deformation mechanisms and understand the mechanical properties. Fig. 3
                           a shows a representative bright-field TEM micrograph of the tensile tested AlCoCrFeNi2.1 EHEA. Distinct modulated FCC(L12) and BCC(B2) lamellar structures were obviously observed based on different contrasts (bright and dark, respectively) in the TEM image. This was because the FCC(L12) phase was thinner than the BCC(B2) phase after twin-jet polishing. This chemical polishing result also suggested that the corrosion resistance of BCC(B2) phase was better than that of FCC(L12) phase. Fig. 3b and c show the TEM-SAEDs of FCC(L12) and BCC(B2) phases, respectively. The presence of super-lattice spots obtained from the two phases (marked by cyan and yellow circles, respectively) revealed both ordered L12 (Fig. 3b) and B2 (Fig. 3c) phases. The formation of ordered L12 structure is rarely reported in eutectic alloys in the literature, whereas the formation of ordered B2 phase is frequently reported owing to the strong negative enthalpy in the Al–Ni system [23–25]. The compositions of the present B2 phase were revealed as ∼38 at.% Ni and ∼37 at.% Al by the following APT analysis (see Table 1
                           ), which hinted that Ni and Al atoms alternately occupied the lattice sites in the B2 unit cell, and other element atoms were substitutional solution atoms [26–28].
